import React from "react";
import ContactUs from "../../component/contents/ContactUs";
import Header, { onContactUsPage } from "../../component/header/Header";
import styles from "../main/Main.module.css";

function Main() {
  console.log(onContactUsPage);
  return (
    <div className={styles.container}>
      <Header />
      {onContactUsPage === true ? <ContactUs /> : null}
      <div className={styles.item1}>
        <div className={styles.item1Circle}></div>
        <div className={styles.item1Card}></div>
      </div>
      <div className={styles.item2}>F</div>
      <div className={styles.item3}>G</div>
    </div>
  );
}

export default Main;
